/* create page */
}

@-moz-document url-prefix("https://www.roblox.com/users/") {
/* users */

    #unfriend-btn {
        background: linear-gradient(126deg, rgb(241, 54, 98) 0%, rgb(177, 1, 63) 100%);
        border: none;
        color: white;
        transition: 0.3s;
    }
    #unfriend-btn:hover {
        box-shadow: 2px 6px 15px #0000004d;
        transition: 0.3s;
    }
    
    /* chat button */
    .btn-primary-md {
        background: linear-gradient(126deg, rgb(235, 200, 0) 0%, rgb(228, 153, 23) 100%);
        border: none;
        color: white !important;
        transition: 0.3s;
    }
    .btn-primary-md:hover {
        box-shadow: 2px 6px 15px #0000004d;
        transition: 0.3s;
    }
    
    .profile-join-game {
        background: linear-gradient(126deg, rgba(50,196,36,1) 0%, rgba(0,179,75,1) 100%);
        border: none;
        color: white !important;
        transition: 0.3s;
    }
    .profile-join-game:hover {
        box-shadow: 2px 6px 15px #0000004d;
        transition: 0.3s;
    }
    
    /* rectangles */
    .section-content {
        border-radius: 8px;
    }
    
    /* dots in corner */
    #profile-header-more {
        margin-top: 6px;
        margin-right: 6px;
    }
    
    /* profile avatar icon background */
    .dark-theme .avatar {
        background: #030303;
    }
}

@-moz-document url-prefix("https://www.roblox.com/search/users") {
/* user search */
    
    /* profile search cards */
    .avatar-card-container {
        scale: 1;
        opacity: 0.9;
        transition: 0.4s;
    }
    .avatar-card-container:hover {
        scale: 1.05;
        opacity: 1;
        transition: 0.1s;
    }
    .dark-theme .avatar-card-container:hover {
        background: linear-gradient(180deg, rgba(90,93,96,1) 0%, rgba(54,56,58,1) 60%);
        box-shadow: 0px 5px 25px #00000078;
    }
    .light-theme .avatar-card-container:hover {
        background: linear-gradient(180deg, rgba(222,222,222,1) 0%, rgba(253,253,254,1) 75%, rgba(253,253,254,1) 94%); 
        box-shadow: 0px 5px 25px #00000029;
    }
}
